import React, { Component } from 'react';
import './App.css';
import { names } from "./file2";

const { firstName, lastName, email } = names;

function Welcome(props) {
    return <h1>Hello, {props.name}</h1>;
}

function WelcomePerson(props) {
    return <h1>Hello, {props.fn} {props.ln}: {props.email}</h1>;
}

function App() {
    return (
        <div>
            <Welcome name="Sara" />
            <Welcome name="Cahal" />
            <Welcome name="Edite" />
            <WelcomePerson fn={firstName[0]} ln={lastName[0]} email={email[0]} />
        </div>
    );
}

export default App;
